import { arnd } from "../utils/randUtils";

interface PostalCodeInfo {
    zipcode: string;
    originalName: string;
    parsedName: string;
}

export function getPostalAreas(): PostalCodeInfo[] {
    return currentAreas;
}

export function findPostalCodesForCity(city: string): PostalCodeInfo[] {
    return currentAreas.filter((val: PostalCodeInfo) => {
        return val.parsedName === city;
    });
}

export function getRandomPostalCode(): PostalCodeInfo {

    return arnd(currentAreas);
}


