const currentAreas: PostalCodeInfo[] = allPostalAreas.reduce(
    (areas: PostalCodeInfo[], current: any): PostalCodeInfo[] => {
        if (current.lakkauttamispaivamaara.length > 0 || current.postinumero.length < 4) {
            return areas;
        }

        let parsedName: string = current.nimi.trim();

        if(current.nimi.includes("-") && current.nimi !== "Mänttä-Vilppula") {
            const arname: string[] = current.nimi.split("-");
            parsedName = arname[0].trim();
        }
        // console.log(parsedName.padEnd(30, " "), " :\t ", parsedName.replace(/\d/g, ''));
        const info: PostalCodeInfo = {
            zipcode: current.postinumero,
            originalName: current.nimi,
            parsedName: parsedName.replace(/\d/g, "").trim(),
        };
        areas.push(info);
        return areas;
    },
    []
);